import { Container, Row, Footer } from "react-bootstrap";
export const About = () => {
  return (
    <Container fluid>
      <Row>
        <Footer>
          <p>&copy 2023 Melissa Hookey</p>
        </Footer>
      </Row>
    </Container>
  );
};

export default About;
